import React from "react";

function Profile({ name, email }) {
  return (
    <section className="profile page__container">
      <div className="profile__container">
        <h3 className="profile__greetings">Привет, {name}!</h3>
        <form className="profile__list">
          <label
            className="profile__lable">Имя</label>
          <input className="profile__input" />


          <button type="submit" className="profile__button profile__button_type_edit">Редактировать</button>
        </form>
        <button type="button" className="profile__button profile__button_type_exit">Выйти из аккаунта</button>
      </div>
    </section>
  );
}

export default Profile;
